import React from 'react';
import { Button } from '@mui/material';

function App() {
  return (
      <div style={{ padding: "20px", textAlign: "center" }}>
        <h1>Bienvenue au tournoi !</h1>
        <Button variant="contained" color="primary">
          Cliquez ici
        </Button>
      </div>
  );
}

export default App;
